import React from 'react';
import 'onsenui/css/onsenui.css';
import 'onsenui/css/onsen-css-components.css';
var Ons = require('onsenui');
var ROns = require('react-onsenui');

class TabBar {
    constructor(props) {
        this.TabBar = new ROns.Tabbar();
        this.TabBar.Position = "auto";

        this.Menu = ['Главная', 'Категории', 'ЛК'];
    }
    


    GetTabs() 
    {
        return this.Menu.forEach(element => {
            <ROns.Tab>
                {element}
            </ROns.Tab>
        });
    }
      
    render() {
        return (
            <this.TabBar>
                {this.GetTabs()}
            </this.TabBar>
        );
    }
}


export default TabBar;
